SELECT 
    folio AS Folio, 
    fecha AS Fecha, 
    motivo AS Motivo, 
    enfermedad AS Enfermedad, 
    observaciones AS Observaciones, 
    tratamiento AS Tratamiento, 
    IF(estado LIKE '0','Inactivo','Activo') AS Estado, 
    CONCAT_WS(' ', nombre, apellido, '-', id) AS NombreCompleto 
FROM 
    expediente_clinico 
INNER JOIN 
    pacientes ON id_paciente = id;
    
DELIMITER //
CREATE TRIGGER eliminar_citas_paciente BEFORE DELETE ON pacientes
FOR EACH ROW
BEGIN
  UPDATE gestion_cita
  SET estatus = 'Disponible', idPaciente = NULL , detalleCita=NULL
  WHERE idPaciente = OLD.id;
END;
//
DELIMITER ;


